class Solution(object):
	def minIncrementForUnique(self, A):
		"""
		:type A: List[int]
		:rtype: int
		"""
		from collections import deque
		queue = deque()
		queue.appendleft((A, 0))
		step = 0
		while queue:
			temp = queue.pop()
			print(temp[0])
			cur = []

			n = len(temp[0])
			if n == len(set(temp[0])):
				return temp[1]
			i = 0
			while i < n:
				print("å†…")
				temp_list = temp[0].copy()
				temp_list[i] += 1
				print(temp_list)
				cur.append((temp_list, step + 1))
				i += 1
			print(cur)
			queue.extendleft(cur)
			step += 1
			break

	def minIncrementForUnique1(self, A):
		res = [0 for _ in range(80001)]
		# print(res)
		for num in A:
			res[num] += 1
		# print(res)
		i = 0
		obj = 0
		flag = 0
		while i < 80001:
			if res[i] > 1:
				# print("er")
				j = max(i,flag)
				while j < 80001 and res[j] != 0:
					j += 1
				flag = j+1
				res[j] = 1
				res[i] -= 1
				obj += (j-i)
			if res[i] <=1:
				i += 1
				continue
			print("----")
		return obj

	def minIncrementForUnique2(self, A):
		# lookup = set(A)
		A.sort()
		res = 0
		n = len(A)
		for i in range(1,n):
			if A[i]<=A[i-1]:
				res +=(A[i-1]-A[i]+1)
				A[i] = A[i-1]+1
		return res


